arStrings.szText:
Infliger des dégâts à une cible à proximité avec des compétences de {c_important}tir d’élite{/c} ou de {c_important}coupe-jarret{/c} vous confère un bonus à la vitesse d’attaque de {c_number}[{SF_0}*100|%+|]{/c} pendant {c_number}{buffduration:RANGED_BONUS}{/c} s.

Si les deux bonus à la vitesse d’attaque sont actifs, vos dégâts augmentent de {c_number}[{SF_2}*100|x%|]{/c} de votre bonus aux dégâts contre les cibles subissant une perte de contrôle.

Bonus aux dégâts actuel : {c_number}[SF_3 * 100|%x|]{/c}
